import './App.scss';
import {Routes, Route} from "react-router-dom"
import Home from './components/Home/Home';
import Error from './components/Error/Error'
function App() {
  return (
    <div className="App">
    <Routes>
      <Route path="/" element={<Home />} /> 
      <Route path="/error" element={<Error />} />
    </Routes>
    </div>
  );
}


export default App;
